"original": |2-
     The request has succeeded, but some supplied attribute values
     conflicted with the values of other supplied attributes.  Either
     (1) these conflicting values were substituted with (supported) values
     or (2) the attributes were removed in order to process the Job
     without rejecting it.  Attributes or values that conflict with other
     attributes and have been substituted or ignored MUST be returned in
     the Unsupported Attributes group of the response for all operations
     as supplied by the Client.  See Sections 4.1.7 and 4.2.1.2.
"fixed": |-
  The request has succeeded, but some supplied attribute values conflicted with the values of other supplied attributes.  Either (1) these conflicting values were substituted with (supported) values or (2) the attributes were removed in order to process the Job without rejecting it.  Attributes or values that conflict with other attributes and have been substituted or ignored MUST be returned in the Unsupported Attributes group of the response for all operations as supplied by the Client.  See Sections 4.1.7 and 4.2.1.2.
"ko": |-
  요청이 성공했지만 제공된 일부 속성 값이 제공된 다른 속성 값과 충돌했습니다. (1) 이러한 충돌하는 값은 (지원되는) 값으로 대체되었거나 (2) 작업을 거부하지 않고 처리하기 위해 속성이 제거되었습니다. 다른 속성과 충돌하고 대체되거나 무시된 속성 또는 값은 클라이언트가 제공한 모든 작업에 대한 응답의 지원되지 않는 속성 그룹에 반환되어야 합니다. 섹션 4.1.7 및 4.2.1.2를 참조하십시오.
